Dzień dobrym, mam do sprzedania samochód osobowy marki Mercedes-Benz A-klasa wyprodukowany w 2006 roku, który został wyposażony w silnik wysokoprężny turbodoładowany o pojemności 1992 cm3, legitymujący się mocą 82 KM, który pokonał do tej pory 220000 km. Samochód pod względem mechanicznym w dobrym stanie, silnik odpala bez problemów ciepły czy zimny, niestety w samochodzie skończyło się sprzegło i nie jeździ, zawieszenie pracuje prawidłowo, cicho wybiera nierówności, układ kierowniczy jest precyzyjny. Wizualnie Mercedes prezentuje się jak na zdjęciach dodam, że pojazd jest używany i posiada normalne ślady wynikające z wieku i eksploatacji. Wnętrze pojazdu prezentuje się bardzo dobrze, jest czyste, zadbane.



A-klasa jest wyposażenia w:

- Klimatyzację;

- ABS z ESP;

- Centralny zamek;

- Elektryczne szyby przednie;

- Podgrzewane fotele przednie;

- 15 calowe alufelgi;

- Elektryczne lusterka;

- 4 x airbag;

I wiele innych rzeczy o których zapomniałem wspomnieć.



Zapraszam wszystkie zainteresowane osoby do kontaktu telefonicznego w celu uzyskania większej ilości informacji. 



Samochód do obejrzenia w Łodzi po wcześniejszym umówieniu się.



OC ważne do 26.06.2025 roku.

Przegląd techniczny 26.08.2025 roku.

Witam. Posiadam do sprzedania Seata Toledo III 1.9 TDI BKC 105 KM rok produkcji 2005. Auto w moim posiadaniu od 6 lat. W okresie posiadania wszystkie naprawy wykonywane na bieżąco. Z poważniejszych napraw regeneracja turbiny, wtrysków, wymienione sprzęgło, zaciski tył z tarczami oraz wiele innych. Auto posiada opony wielosezonowe zakupione latem. Świeżo po serwisie filtrów oraz oleju. W lato dobita i odgrzybiona klimatyzacja. PT 01.2026, OC 04.2025. Technicznie wsiadać i użytkować.



Wyposażenie to:



* Klimatyzacja;



* 4 poduszki powietrzne;



* Elektryczne szyby;



* Wspomaganie kierownicy;



* Centralny zamek;



* Czujniki parkowania tył;



* ABS;



* TCS;



* Radio multimedialne;



* Regulacja kierownicy dwu płaszczyznach;



* Regulacja fotela kierowcy w trzech płaszczyznach;



* ISOFIX.



Dla zainteresowanych więcej informacji udzielę telefonicznie.

